(1, 3, 1, 'SPGE-SSS-28', 'Segària Sin Santo', 657237094, 'segariasinsanto@gmail.com', 'Ondara (Alacant)', 'https://sinsanto.blogspot.com', 'Repartim a Oliva a Domicili \n. Paquets de 6kg, cost de transport', 'Recuperació de bancal abandonat, projecte personal, experimentació amb tota classe de fuiters mediterranis i tropicals.', './img/productorescat1/segariasinsanto.png'),
(2, 4, 2, 'SPGE-MB-26', 'Molí de Baix', 644563226, 'molidebaix@riseup.net', 'Vallada (La costera, València)', '-', 'Els nostres productes es poden trobar els dissabtes i diumenges ', 'Molí de Baix és un projecte de producció agroecològica que fertilitza amb fems dels seus animals. Hi ha una gran diversitat de c', './img/productorescat2/molidebaix.png'),
(5, 13, 1, 'SPGE-Ca L\'EkoRoca', 'Ca L\'EkoRoca', 655348282, 'ekoroca@gmail.com', 'Meliana', 'https://es-es.facebook.com/LEkoRoca/', 'Zona de Meliana i a consultar.', 'Projecte de producció de fruites i hortalisses de temporada, Ximo cultiva i viu en l’Horta de Meliana', './img/productorescat1/ekoroca.png'),
(6, 16, 1, 'SPGE-Ritxi', 'Ritxi', 693800493, 'ritxi@gmail.com', 'Meliana/Alboraia/Algar del Palància', 'https://es-es.facebook.com/RitxiEcollaures/', 'Meliana, València, dies a consultar.', 'Ja va per a 19 anys des que peguí la primera “aixetà” a l’Horta. Sempre treballant des de projectes col.lectius amb el compromís social.', './img/productorescat1/ritxi.png'),
(7, 17, 1, 'SPGE-CV-15', 'La CaterVa', 666777888, 'lacatervaav@gmail.com', 'Chelva', 'https://es-es.facebook.com/LaCaterVaEcollaures/', 'Dissabte dia de recollida a Xelva, encara que durant l’estat d’alarma estem fent el repartiment a domicili.\nDijous repartiment d’hortalissa, fruita i oli d’oliva a botigues i altres productores de l’SPG de València i rodalies, la Serrania, Camp de Túria.', 'La Caterva som una associació que treballa des de l’agroecologia per la sobirania alimentària a Xelva, comarca de la Serrania. Som 4 persones amb dedicació variable treballant bancals, la major part cedits, d’horta, oliveres i altres fruiters; fem custodia del territori, activitats de divulgació i gaudim de la vida rural.', './img/productorescat1/lacaterva.png'),
(8, 22, 1, 'SPGE-FDP-22', 'Fruites de Pego Agroecologia', 649196791, 'fruitesdepego@gmail.com', 'Pego', 'https://es-es.facebook.com/FruitesDePegoEcollaures/', 'Repartim a València i rodalies, també a la Marina i la Safor. Estem en els mercats de la Terra de la Vall de Gallinera.\r\nMínim taronja 20 kg, alvocat 6 kg.', 'Som un projecte familiar de producció de fruita, creant refugis i espais de biodiversitat. Treballem l’educació ambiental i la difusió dels valors de l’agroecologia. Experimentem espècies i varietats de fruiters, verdures, aromàtiques, mengívoles silvestres, flors… i també criem gallines. La major part és per autoconsum, però venem els excedents.', './img/productorescat1/fruitesdepego.png'),
(9, 23, 1, 'SPGE-DNM-09', 'Agrodinamo', 685497503, 'manuela.molina@ladinamoasc.org', 'Godella', ' https://ladinamoasc.com/', 'Mercat de la UPV i caixes de verdures baix comanda.\nRecollida en el local Agrodinamo, Godella.', 'Agrodinamo és un projecte de Inserció Sociolaboral per a joves, que desenvolupa part de la seua tasca d\'acompanyament als processos d\'aquest joves en l\'horta de Godella en un camp productiu d\'hortalisses i taronges. El projecte és compartit per 24 xavales i 3 educadores.', './img/productorescat1/agrodinamo.png'),
(10, 24, 1, 'SPGE-Ecoserranía', 'Ecoserranía', 679148008, 'ecoserrania@gmail.com', 'Tuéjar', 'http://www.facebook.com/ecoserrania', 'Servim dimarts a restaurants, grups de consum i altres productors. Mercat Ecomaclet i altres.', 'Ecoserrania és un projecte familiar, fa 9 anys vàrem apostar per una vida al món rural. Amb alguns camps cedits, altres arrendats i uns pocs propis emprenguérem aquest camí de recuperació de terres. Cultivem fruites i verdures de temporada,  ametlles i fem oli amb la base de l’agroecologia i la sobirania alimentària.', './img/productorescat1/ecoserrania.png'),
(11, 25, 1, ' SPGE-LP-11', 'La Pebrella', 662371771, 'pebrellainfo@gmail.com', 'Alborache', 'www.lapebrella.es', 'Repartim dimarts a domicili en la Foia de Bunyol (Alborache, Buñol, Chiva, Cheste…), Ribera alta (Torís, Godelleta, Montserrat), València i Horta Sud ( Picanya, Torrent, Alcàsser, Picassent, Albal, etc..). Tenim punts de distribució a Picanya i Alcàsser.', 'La Pebrella som un projecte  agroecològic amb 20 anys d’experiencia en la producció de verdures i hortalisses. Repartim a domicili, punts de distribució i alguna botiga concienciada. En l’actualitat el projecte està conformat per Vicent, Cristina i Neus.\nCaixes tancades o a granell (minim 14€ de comanda).', './img/productorescat1/lapebrella.png'),
(12, 16, 5, 'SPGE-Ritxi', 'Ritxi', 693800493, 'ritxi@gmail.com', 'Meliana/Alboraia/Algar del Palància', 'https://es-es.facebook.com/RitxiEcollaures/', 'Meliana, València, dies a consultar.', 'Ja va per a 19 anys des que peguí la primera “aixetà” a l’Horta. Sempre treballant des de projectes col.lectius amb el compromís social.', './img/productorescat5/ritxi.png'),
(13, 17, 5, 'SPGE-CV-15', 'La Caterva', 666777888, 'lacatervaav@gmail.com', 'Chelva', 'https://es-es.facebook.com/LaCaterVaEcollaures/', 'Dissabte dia de recollida a Xelva, encara que durant l’estat d’alarma estem fent el repartiment a domicili.\r\nDijous repartiment d’hortalissa, fruita i oli d’oliva a botigues i altres productores de l’SPG de València i rodalies, la Serrania, Camp de Túria.', 'La Caterva som una associació que treballa des de l’agroecologia per la sobirania alimentària a Xelva, comarca de la Serrania. Som 4 persones amb dedicació variable treballant bancals, la major part cedits, d’horta, oliveres i altres fruiters; fem custodia del territori, activitats de divulgació i gaudim de la vida rural.', './img/productorescat5/lacaterva.png'),
(14, 4, 5, 'SPG-MB-26', 'Molí de Baix', 644563226, 'molidebaix@riseup.net', 'Vallada', 'https://es-es.facebook.com/MolideBaix/', 'Els nostres productes es poden trobar els dissabtes i diumenges pel matí en el Molí de Baix.', 'Molí de Baix és un projecte de producció agroecològica que fertilitza amb fems dels seus animals. Hi ha una gran diversitat de cultius, de flora arvense i biodiversitat animal.', './img/productorescat5/molidebaix.png'),
(15, 24, 5, 'SPGE-Ecoserrania', 'Ecoserranía', 679148008, 'ecoserrania@gmail.com', 'Tuéjar', 'http://www.facebook.com/ecoserrania', 'Servim dimarts a restaurants, grups de consum i altres productors. Mercat Ecomaclet i altres.', 'Ecoserrania és un projecte familiar, fa 9 anys vàrem apostar per una vida al món rural. Amb alguns camps cedits, altres arrendats i uns pocs propis emprenguérem aquest camí de recuperació de terres. Cultivem fruites i verdures de temporada,  ametlles i fem oli amb la base de l’agroecologia i la sobirania alimentària.', './img/productorescat5/ecoserrania.png'),
(16, 26, 4, 'SPGE-BN-31', 'Bee Natura', 637896940, 'info@beenatura.es', 'Bétera', 'http://www.beenatura.es/', 'Mercat UPV i repartiment a València els dijous. A domicili abonant el desplaçament.\nComanda mínima: 2 kg de mel / 2 flascons de pròpolis.', 'Projecte familiar d’apicultura sostenible, als nostres parcs Naturals, amb producció limitada i ecològica, respectant el medi ambient que ens rodeja i tot els pol·linitzadors. Amb els productes del rusc i educació ambiental. \nProduïm mels i pròpolis dels nostres parcs naturals, així com experiències ambientals i educacionals.', './img/productorescat4/beenatura.png'),
(17, 27, 4, 'SPGE-LLP-30', 'Lluna Plena Agro Apícola', 651543506, 'mielyabejas@gmail.com', 'València, Godella, Meliana', 'https://mielyabejas.es', 'Només venda directa i mercats de Godella i de la Terra Meliana.\nEn venda directa: lliurament a domicili per vendes majors a 35 €.', 'Projecte integrat per agricultors i apicultors. Produïm mels monoflorals de temporada: romaní, farigola, espígol, bruc, i fruits secs: ametlles, nous, avellanes, i altres.', './img/productorescat4/llunaplenaagroapicola.png'),
(18, 28, 4, 'SPGE-VF-07', 'Vicent de la Foia', 650943818, 'vicentdelafoia@gmail.com', 'Potries', 'https://es-es.facebook.com/VicentFoiaEcollaures/', 'Reparto als pobles de Potries, Ador, Beniarjó, Rafelcofer i La Font d’en Carròs els divendres.', 'Des de fa uns 10 anys porte endavant una finca de dos hectàrees als peus de l’ermita de Potries i de manera agroecològica cuide gallines, aromàtiques, hortícoles, fruiters i abelles. De manera puntual participe en algunes trobades, escoles lliures, grups afins, pràctiques del Servef i voluntariat en la casa d’acollida d’immigrants de Potries.\nMantenim una estreta relació amb altres projectes que col·laboren oferint al grup de consum El Cabasset de Gandia de manera setmanal.', './img/productorescat4/vicentdelafoia.png'),
(19, 29, 3, 'SPG-PS-16', 'Pan de Sol', 631114273, 'panesdesol@outlook.com', 'Massamagrell', 'https://es-es.facebook.com/PanDeSolEcollaures/', 'Mercat de la UPV i de la Patacona.', 'Micro panaderia familiar (Eric i Sol) des de fa 5 anys. Treballem amb massa mare, farines ecològiques i locals. Venda en mercats de venda directa de l\'horta nord i en caixes de verdures de projectes agroecològics.\nPans variats, crestes i galetes.', './img/productorescat3/pandesol.png'),
(20, 30, 3, 'SPGE-ACE-3', 'L\'aixada com eixida', 663886822, 'cooperativaaixadacomeixida@gmail', 'Picassent', 'https://aixadacomeixida.wixsite.com/aixadacomeixida', 'Repartim dimarts en Picassent i Alcàsser (CSA El Montó) i Picanya i Valėncia (a consultar).', 'Associació local que treballa en la gestió de dos espais agroecològics i en la divulgació de la sobirania alimentària. Disposem de cítrics i hortalisses de collita pròpia i elaborem productes de forn, cosmètica natural i esdeveniments divulgatius.', './img/productorescat3/aixadacomeixida.png'),
(21, 30, 2, 'SPGE-ACE-3', 'L\'Aixada com Eixida', 663886822, 'cooperativaaixadacomeixida@gmail', 'Picassent', 'https://aixadacomeixida.wixsite.com/aixadacomeixida', 'Repartim dimarts en Picassent i Alcàsser (CSA El Montó) i Picanya i Valėncia (a consultar).', 'Associació local que treballa en la gestió de dos espais agroecològics i en la divulgació de la sobirania alimentària. Disposem de cítrics i hortalisses de collita pròpia i elaborem productes de forn, cosmètica natural i esdeveniments divulgatius.', './img/productorescat2/aixadacomeixida.png'),
(22, 31, 2, 'SPGE-ME-27', 'Manzanas Esperidas', 621208979, 'manzanas@esperidas.com', 'CASTILFABIB (Rincón de Ademuz, Valencia) i BIAR (Alacant)', 'https://esperidas.com/', 'Pomes entre novembre-febrer i transformats de març a març (domicilis, gdc, tendes amigues…)\n\nComanda mínima: 10 kg de pomes/8 pots de conserves de poma\nEntreguem comandes a domicili en temporada de pomes i tenim productes transformats a diferents mercats. ', 'Es tracta d’un projecte de recuperació i producció de pomes de varietat esperiega. Transformem la poma per  revaloritzar durant tot l’any mitjançant els transformats. El projecte el formen ANNA BALLESTER i MAR ESTEVE i els nostres principis son l’agroecologia, treballar per la sobirania alimentària, cuidar els canals curts de comecialització i treballar per aconseguir obradors compartits als municipis xicotets.', './img/productorescat2/manzanasesperidas.png'),
(23, 32, 2, 'SPGE-BLL-35', 'La Barraka de la Llum', 630576439, 'labarrakadelallum@gmail.com', 'Espai Trellat, Camí la Mar s/n,46530 Puçol, València', 'https://es-es.facebook.com/LaBarrakaDeLaLlumEcollaures/', 'Repartim dijous, actualment tenim punts de replega en: Benimaclet,  Algirós,  mercat agroecològic UPV,  Bétera, L’Eliana,  Alboraia,  Montcada i Puçol. \nNo hi ha comanda mínima.', 'La Barraka de la Llum és la vesant productiva de Col·lectiu Trellat. Des de 2010 treballem per la recuperació,  regeneració i revitalització del paisatge cultural de L’Horta mitjançant tècniques de permacultura i agricultura regenerativa.  Actualment oferim FERMENTS VIUS elaborats amb matèries primeres locals. Treballem des del criteri de l’Alimentació Sostinguda per la Comunitat i tenim una relació directa i propera amb les nostres consumidores. Actualment el projecte el sostenim Esther i Toni.', './img/productorescat2/barrakadelallum.png'),
(24, 33, 2, 'SPGE-AZ-36', 'Almazen Natural', 678447461, 'proyectoalmazennatural@gmail.com', 'Benetússer', 'https://es-es.facebook.com/proyectoalmazennatural/', 'Repartiment a domicili i en grups de consum de dimarts a dijous.\n15 € per a particulars / 25 € grups consum. Ports Gratuïts a partir de 30 €', 'AlmaZen Natural es un proyecto emprendedor de elaboración de alimentos agroecológicos vegetarianos y catering saludable para eventos y grupos.\nHamburguesas vegetales, croquetas, rollitos, patés, cremas vegetales, raciones, etc.\nColaboramos con el colectivo Xicoteta Elaboració Agroecológica.', './img/productorescat2/almazennatural.png'),
(25, 28, 1, 'SPGE-VF-07', 'Vicent de la Foia', 650943818, 'vicentdelafoia@gmail.com', 'Potries', 'https://es-es.facebook.com/VicentFoiaEcollaures/', 'Reparto als pobles de Potries, Ador, Beniarjó, Rafelcofer i La Font d’en Carròs els divendres.', 'Des de fa uns 10 anys porte endavant una finca de dos hectàrees als peus de l’ermita de Potries i de manera agroecològica cuide gallines, aromàtiques, hortícoles, fruiters i abelles. De manera puntual participe en algunes trobades, escoles lliures, grups afins, pràctiques del Servef i voluntariat en la casa d’acollida d’immigrants de Potries.\r\n\r\n', './img/productorescat1/vicentdelafoia.png'),
(26, 31, 1, 'SPGE-ME-27', 'Manzanas Esperidas', 621208979, 'manzanas@esperidas.com', ' CASTILFABIB (Rincón de Ademuz, Valencia) i BIAR (Alacant)', 'https://esperidas.com/', 'Pomes entre novembre-febrer i transformats de març a març (domicilis, gdc, tendes amigues…).\r\nEstem a mercats con Ecomaclet una vegada al mes, firetes d’estiu, festivals i Fira de la Poma Esperiega al Racó d’Ademús. \r\nComanda mínima: 10 kg de pomes/8 pots ', 'Es tracta d’un projecte de recuperació i producció de pomes de varietat esperiega. Transformem la poma per  revaloritzar durant tot l’any mitjançant els transformats. El projecte el formen ANNA BALLESTER i MAR ESTEVE i els nostres principis son l’agroecologia, treballar per la sobirania alimentària, cuidar els canals curts de comecialització i treballar per aconseguir obradors compartits als municipis xicotets.\r\nPomes esperiegues, melmelades, compotes  cremes dolçes i gelatines de poma esperiega', './img/productorescat1/manzanasesperidas.png'),
(28, 34, 1, 'SPGE-AG-30', 'Agret Cultura de Terra', 627751676, 'lagret.net@gmail.com', 'Godella/Rocafort', 'https://lagretnet.wordpress.com/', 'Enviaments a domicili i replegada al Mas de l’Agret: dimecres i dijous. Venda directa al Mas: dissabtes de matí.\nEn quant a les relacions amb els clients, busquem conjuntament ser conscients de la feina que hi ha darrere de cada caixeta.', 'L’AGRET és un projecte associatiu, jove que neix l’any 2016 amb base agroecològica. Conformat per Cristina, Álvaro i Ferran, i moltes companyes incondicionals.\nProduïm fruites i hortalisses e incorporem pa i fruita d’altres projectes amics.', './img/productorescat1/agret.png'),
(29, 35, 1, 'SPGE-VS-2', 'Vorasenda', 655030315, 'agroecologia@vorasenda.es', 'Carpesa (Horta Nord)', 'https://www.facebook.com/VorasendaEcollaures/', 'A botigues i restaurants: dilluns i dijous; a clients individuals dijous.\nDonem la possibilitat de demanar comandes al detall d’un ampli ventall de productes que setmanalment ofertem.', 'Vorasenda és un projecte agroecològic amb 10 anys de trajectòria, ubicat a Carpesa i conformat per Fabiola, Pablo, Manu, Bert i Xavi. Cultivem verdures i fruites agroecològiques i de temporada. Abastim a botigues, restaurants, cooperatives i a clients i clientes individuals.\nTot tipus d’hortícoles, cítrics i fruita d’estiu.', './img/productorescat1/vorasenda.png'),
(30, 30, 1, 'SPGE-ACE-3', 'L\'aixada com eixida', 663886822, 'cooperativaaixadacomeixida@gmail', 'Picassent', 'https://aixadacomeixida.wixsite.com/aixadacomeixida', 'Repartim dimarts en Picassent i Alcàsser (CSA El Montó) i Picanya i Valėncia (a consultar).', 'Associació local que treballa en la gestió de dos espais agroecològics i en la divulgació de la sobirania alimentària. Disposem de cítrics i hortalisses de collita pròpia i elaborem productes de forn, cosmètica natural i esdeveniments divulgatius.', './img/productorescat1/aixadacomeixida.png'),
(31, 36, 1, 'SPGE-LaBota', 'La Bota', 661209355, 'alquerialabota@gmail.com', 'Foios', 'https://es-es.facebook.com/AlqueriaLaBotaEcollaures/', 'Dimarts a Patraix/Jesus. Dimecres Ruzafa/Malilla. Si està propet d’aquests dos punts també arribem.\n', 'La Bota és un projecte familiar, Magalí, Malva, Mauro i Xavo vivim en una antiga casa d’horta on conreem la terra com fa 100 anys amb cavalls i tot fet a mà i repartim en bicicleta. Fem hortalisses, fruita i aromàtiques per a autoconsum i per a una xicoteta comunitat de consum que hem creat al barri de Patraix de València.\nHortalisses, nespres,taronja, llima, mangrana, caqui, albercocs i aromàtiques.', './img/productorescat1/labota.png'),
(32, 37, 1, 'SPGE-A3H-33', 'Al3Horts', 636007792, 'al3horts@gmail.com', 'Albuixech', 'https://al3hortsweb.wordpress.com/', 'Estem els dissabtes a la Tira de Comptar de Mossén Sorell. Repartim els dimarts, als punts de recollida d’Albuixech i dels barris del Cabanyal, Russafa, El Carme i Benimaclet, de València.\nTambé repartim a domicili (vore zones) amb un suplement de 4€.', 'Al3Horts és un projecte familiar situat a l’Horta Nord, portem més de 10 anys apostant per l’agroecologia i els canals curts de comercialització.\nOferim caixes obertes de fruita i verdura de producció pròpia i d’altres agricultors.', './img/productorescat1/al3horts.png'),
(33, 38, 1, 'SPGE-LFA-4', 'La Fanecà', 660628872, 'lafaneca@gmail.com', 'Alboraia', 'http://www.lafaneca.net/', 'A domicili dimarts València i rodalies. A botigues amigues dimarts i dijous. Botiga pròpia a Alboraia, horari: DLL 17:30-20:30h, DM, DX, DV i DS 10-14h.\nMés de 20€, servei a domicili gratuït.', 'La Fanecà començà l’any 2010 conscienciades en la defensa de l’Horta, l’agroecologia, la sobirania alimentària, el decreixement… Actualment en formem part Marina, Draz, Patri, Enric i Xandre.\nVerdures del Parc Natural de L’Horta i fruites.', './img/productorescat1/lafaneca.png'),
(35, 2, 1, 'prova', 'prova', 666777888, 'prova', 'prova', 'prova', 'prova', 'prova', './img/productorescat1/lafaneca.png');

